<script type='text/javascript'> // js function equivalent to np.linspace
function makeArr(startValue, stopValue, cardinality) {
  var arr = [];
  var step = (stopValue - startValue) / (cardinality - 1);
  for (var i = 0; i < cardinality; i++) {
	arr.push(startValue + (step * i));
  }
  return arr;
}

//given bnds {xmin: , xmax: , ymin: , ymax: }, Xdim = number of columns, Ydim number of rows
// returns an array of coordinate objects in a grid  
function genGridPts(bnds,Xdim,Ydim){
  var xa = makeArr(bnds.xmin,bnds.xmax,Xdim)
  var ya = makeArr(bnds.ymin,bnds.ymax,Ydim)
  var cx = d3.cross(ya,xa).map(v=>{return {'x':v[1],'y':v[0]}})
  return cx
    }
//builds an array of n points, from bnds [min,max] centered on value ptX (ptX is between min and max)
function arrayCenteredOnPt(bnds,n,ptX){
    var step = (bnds[1] - bnds[0] )/ (n - 1);
       //step forward
       var f = []
       var i = 0
       do {
       	var xn = ptX+i*step
        f.push(xn)
        i++
       	} while (xn<bnds[1])
       //step backward
       var b = []
       var i = 1
       do {
       	var xn = ptX+i*-step
        b.push(xn)
        i++
       	} while (xn>bnds[0])
    b.reverse()
    return b.concat(f)
    	}
		
//transforms columndatasource data to array of objects
function cds_to_objarray(cds_data){
  var keys = Object.keys(cds_data)
  var z = d3.transpose(Object.values(cds_data))
  var o = z.map(x=>Object.assign(...keys.map((k, i) => ({[k]: x[i]}))))
  return o}
  
//transforms array of objects to columndatasource "dictionary"/object 
function objarray_to_cds(objarray){
  var a = d3.transpose(objarray.map(x=>Object.values(x)))
  if (a.length>0){
    var d = Object.assign(...Object.keys(objarray[0]).map((k, i) => ({[k]: a[i]})))
    }
  return d
  }
  
//translates a d3 contour result into multiline-ready CDS data
function contours_to_cds(d3_contour){
    var cxs = []
    var cys = []
    var cv = []
    for (var vi=0;vi<d3_contour.length;vi++){                       
     		   for (var pi=0; pi<d3_contour[vi].coordinates.length;pi++){
     			  for (var ppi = 0; ppi<d3_contour[vi].coordinates[pi].length;ppi++){                                  
     					  var xy = d3.transpose(d3_contour[vi].coordinates[pi][ppi])
     					  cxs.push(xy[0])
     					  cys.push(xy[1])
     					  cv.push(d3_contour[vi].value)
     					  }
     					  }
     				   }
    return {'z':cv,'xs':cxs,'ys':cys}
    }
//numpy.clip equiv to bound a number
function clamp(num, lower, upper) {
		  return Math.min(Math.max(num, lower), upper);
	  }

//piecewise 1D interp
//given xx and yy  arrays, and xx is ascending, finds where xnew fits in xx, and interpolates a y
function interp(xnew,xx,yy){
   var fb = getFirstBetween(xnew,xx)
   if (fb['il']==undefined){
		   return yy[0]
		   }
   else if (fb['ir'] == undefined){
	   return yy[yy.length-1]
	   }
   else {
	   var p = (xnew-fb['xl'])/(fb['xr']-fb['xl'])
	   var r = d3.interpolateNumber(yy[fb['il']],yy[fb['ir']])(p)
	   return r
	   }
   }
   
// array xx is ascending --> returns the first occurence of x being in between two values in xx
// returns {'il':left side index, 'ir',right side index, 'xl': value on left, 'xr',value on right}
function getFirstBetween(x,xx){
  if (x<xx[0]){
    return {'il':undefined,'ir':0,'xl':undefined,'xr':xx[0]}
    }
  for (var i = 0; i < xx.length-1; i++){
    if (x >= xx[i] && x<xx[i+1]){
      return {'il':i, 'ir':i+1, 'xl':xx[i],'xr':xx[i+1]}
      }  
    }
  return {'il':xx.length-1, 'ir':undefined,'xl':xx[xx.length-1],'xr':undefined}
  }</script>

        (function() {
  const fn = function() {
    Bokeh.safely(function() {
      (function(root) {
        function embed_document(root) {
        const docs_json = '{"fc5ed0cb-b7c1-4cf5-9076-7fc59b89248d":{"version":"3.4.1","title":"Bokeh Application","roots":[{"type":"object","name":"Column","id":"p20020","attributes":{"children":[{"type":"object","name":"Div","id":"p19730","attributes":{"stylesheets":[{"type":"object","name":"InlineStyleSheet","id":"p19727","attributes":{"css":"div.bk-clearfix{\\n            font-size: 14pt;\\n            font-family: Arial;\\n            color: #17648D;\\n            text-align: center;\\n            font-weight: bold;\\n            }"}}],"text":"Reservoir Water Balance"}},{"type":"object","name":"Div","id":"p19731","attributes":{"text":"This application visualizes and tests the feasibility of a conceptual water balance on a hypothetical reservoir from 2019 to 2023. It combines observational data, hydrologic model outputs from &lt;a href=\\"https://raven.uwaterloo.ca/\\"&gt;Raven&lt;/a&gt;, and allows for real-time adjustment of two key parameters.&lt;br&gt;&lt;br&gt;\\n\\n&lt;b&gt;Observed components of the water balance consist of:&lt;/b&gt;\\n&lt;ul&gt;\\n&lt;li&gt;Precipitation over the reservoir (via climate data)&lt;/li&gt;\\n&lt;li&gt;Creek inflows (via flow monitoring)&lt;/li&gt;\\n&lt;li&gt;Dam outflows (via flow monitoring)&lt;/li&gt;\\n&lt;li&gt;Reservoir depth over time (via pressure transducers)&lt;/li&gt;\\n&lt;/ul&gt;\\n&lt;b&gt;Simulated components of the water balance consist of:&lt;/b&gt;\\n&lt;ul&gt;\\n&lt;li&gt;Groundwater inflow: A fraction of the recharge signal (simulated by Raven) within the reservoir&#x27;s catchment discharges to the reservoir. This is often referred to as \\"baseflow\\" or \\"interflow\\". This fraction is adjustable with a slider.&lt;/li&gt;\\n&lt;li&gt;Runoff: the amount of precipitation thats runs off the catchment directly to the reservoir, as simulated by Raven&lt;/li&gt;\\n&lt;li&gt;Actual evapotranspiration (AET) - Based on reservoir surface area and potential evapotranspiration (estimated from climate data)&lt;/li&gt;\\n&lt;li&gt;Groundwater outflow: Water seeping out of the reservoir (usually near the dam). The rate depends on reservoir depth and material permeability, which (for this application) is highly simplified into a single adjustable coefficient.&lt;/li&gt;\\n&lt;/ul&gt;\\n\\n&lt;b&gt;How it works:&lt;/b&gt;&lt;br&gt;&lt;br&gt;\\nA predefined reservoir depth-volume-surface area relationship is used to calculate a transient water balance. At each time step, inflows are summed, reservoir depth/surface area are updated, and the resultant outflows are calculated.\\n\\nThe sliders adjust two key unknowns: the seepage coefficient and recharge fraction routed to the reservoir. The resulting simulated reservoir depth (and volume) over time is compared to the observed water level, serving as a calibration target. This application evaluates whether a reasonable calibration can be achieved under the above described conceptualization. If successful, more detailed (e.g. spatially discretized) numerical modelling can follow. If not, the conceptualization must be revisited before more detailed modelling can proceed."}},{"type":"object","name":"Row","id":"p20018","attributes":{"children":[{"type":"object","name":"Slider","id":"p20007","attributes":{"js_property_callbacks":{"type":"map","entries":[["change:value",[{"type":"object","name":"CustomJS","id":"p20017","attributes":{"args":{"type":"map","entries":[["src",{"type":"object","name":"ColumnDataSource","id":"p19721","attributes":{"selected":{"type":"object","name":"Selection","id":"p19722","attributes":{"indices":[],"line_indices":[]}},"selection_policy":{"type":"object","name":"UnionRenderers","id":"p19723"},"data":{"type":"map","entries":[["index",{"type":"ndarray","array":{"type":"bytes","data":"AAAAAAEAAAACAAAAAwAAAAQAAAAFAAAABgAAAAcAAAAIAAAACQAAAAoAAAALAAAADAAAAA0AAAAOAAAADwAAABAAAAARAAAAEgAAABMAAAAUAAAAFQAAABYAAAAXAAAAGAAAABkAAAAaAAAAGwAAABwAAAAdAAAAHgAAAB8AAAAgAAAAIQAAACIAAAAjAAAAJAAAACUAAAAmAAAAJwAAACgAAAApAAAAKgAAACsAA
